// LIBRARY + REACT IMPORTS
import React from "react";

// CSS
import '../css/Analysis.css';

//IMAGES
import placeholder from '../images/placeholder.jpg';
function Analysis() {

    return (
        <>
            {/* MAIN SECTION */}
            <div className="analysis-wrapper ">
                <h1>ANALYSIS</h1>
                <div className="text-wrapper">
                    <p>In our analysis, we observed the data provided to give a rounded image of problematic areas. In this analysis we found major areas such as Queensberry, Jolimont and Southbank  (figure 1) being the major contenders with the largest number of violations compared to any other area in Melbourneâ€™s CBD. Moving further and further into the crevices and depths of the data, we analysed streets, car IDs, parking time zones and many more variables to find out why these areas were fine hotspots.  <br /><br />

We also found that many people revisited these areas and received fines in the same areas multiple times. This brings us to a pattern that we needed to analyse.  <br /><br />

Why were these people regularly attending these areas? <br />
Why were they getting fined in these areas? <br />
Were they present in the same area when getting fined? <br />
Were there problematic spots where many people were fined compared to other parking spots in these areas? <br />
</p>
                </div>
                <div className="images-wrapper">
                    <div className="image-1"><img src={placeholder} className="image-size" /></div>
                    <div className="image-2"><img src={placeholder} className="image-size" /></div>
                    <div className="image-3"><img src={placeholder} className="image-size"/></div>
                </div>

            </div>
        </>
    )
}

export default Analysis;
